import React from 'react';
import { Link } from 'react-router-dom';
import axios from "axios";

const HomePage = () => {
    const handleLogout = async () => {
        try {
            await axios.post('http://localhost:5163/Account/logout');
            console.log('Logged out successfully');
            localStorage.removeItem('token'); // Clear the token from localStorage
            delete axios.defaults.headers.common['Authorization']; // Remove the token from default headers
            // Optionally, redirect the user to the login page or perform other UI updates
        } catch (error) {
            console.error('Error logging out:', error);
        }
    };

    const handleAdminOnly = async () => {
        try {
            await axios.get('http://localhost:5163/Admin/admin-only');
            console.log('Admin endpoint accessed');
            // Handle any UI changes or actions specific to admin-only functionality
        } catch (error) {
            console.error('Error accessing admin endpoint:', error);
            // Handle any errors or display error messages
        }
    };

    const handleArtistOnly = async () => {
        try {
            await axios.get('http://localhost:5163/Artist/artist-only');
            console.log('Artist endpoint accessed');
            // Handle any UI changes or actions specific to artist-only functionality
        } catch (error) {
            console.error('Error accessing artist endpoint:', error);
            // Handle any errors or display error messages
        }
    };

    const handleUserOnly = async () => {
        try {
            await axios.get('http://localhost:5163/User/user-only');
            console.log('User endpoint accessed');
            // Handle any UI changes or actions specific to user-only functionality
        } catch (error) {
            console.error('Error accessing user endpoint:', error);
            // Handle any errors or display error messages
        }
    };

    const handleAuthorized = async () => {
        try {
            const token = localStorage.getItem('token');
            console.log("Token in local storage:", token);

            if (!token) {
                console.error("No token found in local storage.");
                return;
            }
            const response = await axios.get('http://localhost:5163/Admin/authorized', {
                headers: {
                    'Authorization': `Bearer ${token}`
                }
            });
            console.log('Authorization success:', response.data);
        } catch (error) {
            console.error('Error accessing authorized endpoint:', error);
        }
    };

    // Function to handle the new button click
    const handleAdminOnlyClick = async () => {
        try {
            await handleAdminOnly(); // Call the existing function to access the admin-only endpoint
        } catch (error) {
            console.error('Error accessing admin-only endpoint:', error);
        }
    };

    return (
        <div>
            <h2>Welcome to our Application</h2>
            <div>
                <Link to="/register">
                    <button>Register</button>
                </Link>
            </div>
            <div>
                <Link to="/login">
                    <button>Login</button>
                </Link>
            </div>
            <h2>Welcome to our Application</h2>
            <div>
                <button onClick={handleLogout}>Logout</button>
            </div>
            <div>
                <button onClick={handleAdminOnly}>Admin Only</button>
            </div>
            <div>
                <button onClick={handleArtistOnly}>Artist Only</button>
            </div>
            <div>
                <button onClick={handleUserOnly}>User Only</button>
            </div>
            <div>
                <button onClick={handleAuthorized}>Authorized</button>
            </div>
            {/* New button for admin-only functionality */}
            <div>
                <button onClick={handleAdminOnlyClick}>Admin Only (New)</button>
            </div>
        </div>
    );
};

export default HomePage;
